ar in northwest of Italy (Turin) and bought it  on February 9th 2021 from its second owner without having the possibility to seeing it personally. As always, in the world of classic car, we have the privilege to meet amazing people and I asked the president of the Italian SM Owner club - who I met via email - to see the car for me before purchasing it. I have also sent all the pics and video of the car to Dave Burnham who assisted me with the puchasing. After completing the deal, I moved the car to Padova - Italy - to complete the interior refurbishment by Fabrizio Libera, a well respected Citroen specialist in Italy . I saved the original black leather seats but bought a complete new set of brown Forgione\'s leather seats and carpet. Upgrade the radio to Continetal Edison and clean a lot of non original details that have been added throughout the years. I then got in touch with Erik De Widt and spent several hours in organizing the transfer to the USA. Finally the SM was shipped out of Amsterdam to Baltimore where I had the pleasure to meet her for few hours. Due to Burnham\'s busy scheduled, I was directed to David Hume who took my car for the extra care in the engine compartment. A lot of more works that expected was needed but finally the SM is ready. David offered to ship the car to the 2022 Citroen Rendezvous so I can pick it up from there and drive it back to Philly area where I live. I found the idea amazing, called my dad in Italy, bought a ticket for him to travel here in the USA and pick the car together with my daughter at the Rendezvous. This is the best way to celebrate father\'s day! Thanks Rendezvous. It will be my first one but for sure one of the most special one for me. \r\n\r\nAbout the car: Citroen SM 1972 for Italian Market. In AC 525 with brown leather interior and a lot of original details. ',508),(340,'1969','Citroen','D (early)','First DS 21 to arrive in Beverly Hills, California as the demo model for the first US Citroen dealership there. 